import React from 'react'
import './App.css'
import Navbar from '../src/components/Navbar/Navbar'
import Searchbar from './components/Searchbar/Searchbar'

const App = () => {
    return (
        <div>
            <Navbar />
            <div className="App">
                <Searchbar />
            </div>
        </div>
    )
}

export default App;
